from django.contrib.auth.decorators import login_requiredfrom django.core.paginator import Paginatorfrom django.shortcuts import render, redirectfrom apps.warehouse.forms import ItemSearchFormfrom apps.warehouse.models import ItemsModel, ItemsInStockModel@login_requireddef get_items(request):    print('Hello from items')    context = {}    items = ItemsModel.objects.all()    paginator = Paginator(items, 1)    page_number = request.GET.get("page", 1)    page_obj = paginator.get_page(page_number)    print(dir(page_obj))    print(page_obj)    context["items"] = page_obj    return render(request, 'v2/items/items.html', context)@login_requireddef search_items(request):    print('Hello from search items')    form = ItemSearchForm(request.POST)    context = {}    if form.is_valid():        search = request.POST.get("search")        items = ItemsModel.objects.filter(name__icontains=search)        paginator = Paginator(items, 1)        page_number = request.GET.get("page", 1)        page_obj = paginator.get_page(page_number)        print(dir(page_obj))        print(page_obj)        context["items"] = page_obj        return render(request, 'v2/items/items.html', context)    return redirect("warehouse_v2:v2-items")@login_requireddef items_list_view(request):    items = ItemsInStockModel.objects.all()    context = {        "items": items    }    return render(request, 'v2/items/items_list.html', context=context)